var title_f42_16_43266="Short axis tetralogy of Fallot";
var content_f42_16_43266=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1042px;\">",
"  <div class=\"videoplayer\" h264=\"./images/PEDS/73954/Short_axis_tetra_Fallot.mp4?title=Short+axis+tetralogy+of+Fallot\" style=\"width:432px;height:400px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 472px\">",
"   <div class=\"ttl\">",
"    Parasternal short axis view of tetralogy of Fallot (TOF)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 452px; height: 350px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This still frame from the accompanying echocardiographic video clip of the parasternal short axis view of a patient with tetralogy of Fallot (TOF) shows the boundaries of the ventricular septal defect (VSD). The VSD extends from the membranous septum, beneath the tricuspid valve, and into the outlet septum. The conal septum (CS) is intact in the suprascristal region and anteriorly deviated, separating the defect from the right ventricular outflow tract (RVOT). The video clip begins with these structures. The ultrasound transducer then sweeps apically through the ventricles, showing no other septal defects present in this patient.",
"    <div class=\"footnotes\">",
"     RA: right atrium; LA: left atrium; RV: right ventricle; LVOT: left ventricular outflow tract.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
