"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Belanger DR, Tierney MG, and Dickinson G, &ldquo;Effect of Sodium Polystyrene Sulfonate on Lithium Bioavailability,&rdquo;",
"      <i>",
