var title_f42_16_43276="Skin lesions and rashes in coma";
var content_f42_16_43276=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F79446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F79446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Skin lesions and rashes in coma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Lesion or rash",
"      </td>",
"      <td class=\"subtitle1\">",
"       Possible cause",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Antecubital needle marks",
"      </td>",
"      <td>",
"       Opiate drug abuse",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pale skin",
"      </td>",
"      <td>",
"       Anemia or hemorrhage",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Sallow, puffy appearance",
"      </td>",
"      <td>",
"       Hypopituitarism",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hypermelanosis (increased pigment)",
"      </td>",
"      <td>",
"       Porphyria, Addison's disease, chronic nutritional deficiency, disseminated malignant melanoma, chemotherapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Generalized cyanosis",
"      </td>",
"      <td>",
"       Hypoxemia or carbon dioxide poisoning",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Grayish-blue cyanosis",
"      </td>",
"      <td>",
"       Methemoglobin (analine or nitrobenzene) intoxication",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Localized cyanosis",
"      </td>",
"      <td>",
"       Arterial emboli or vasculitis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cherry-red skin",
"      </td>",
"      <td>",
"       Carbon monoxide poisoning",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Icterus",
"      </td>",
"      <td>",
"       Hepatic dysfunction or hemolytic anemia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Petechiae",
"      </td>",
"      <td>",
"       Disseminated intravascular coagulation, thrombotic thrombocytopenic purpura, drugs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ecchymosis",
"      </td>",
"      <td>",
"       Trauma, corticosteroid use, abnormal coagulation from liver disease or anticoagulants",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Telangiectasia",
"      </td>",
"      <td>",
"       Chronic alcoholism, occasionally vascular malformations of the brain",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Vesicular rash",
"      </td>",
"      <td>",
"       Herpes simplex, varicella, Bechet's disease, or drugs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Petechial-purpuric rash",
"      </td>",
"      <td>",
"       Meningococcemia, other bacterial sepsis (rarely), gonococcemia, staphylococcemia, pseudomonas, subacute bacterial endocarditis, allergic vasculitis, purpura fulminans, Rocky Mountain spotted fever, typhus, fat emboli",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Macular-papular rash",
"      </td>",
"      <td>",
"       Typhus, candida, cryptococcus, toxoplasmosis, subacute bacterial endocarditis, staphylococcal toxic shock, typhoid, leptospirosis, pseudomona sepsis, immunological disorders (systemic lupus erythematosus, dermatomyositis, serum sickness)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ecthyma gangrenosum",
"      </td>",
"      <td>",
"       Necrotic eschar often seen in the anogenital or axillary area in Pseudomonas sepsis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Splinter hemorrhages",
"      </td>",
"      <td>",
"       Linear hemorrhages under the nail, seen in subacute bacterial endocarditis, anemia, leukemia, and sepsis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Osler's nodes",
"      </td>",
"      <td>",
"       Purplish or erythematous painful, tender nodules on palms and soles, seen in subacute bacterial endocarditis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Gangrene of digits' extremities",
"      </td>",
"      <td>",
"       Emboli to larger peripheral arteries",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pigmented macules",
"      </td>",
"      <td>",
"       Tuberous sclerosis, neurofibromatosis",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Berger, Joseph R. Clinical Approach to Stupor and Coma. In: Neurology in Clinical Practice: Principles of Diagnosis and Mangement, 4th ed, Bradley, WG, Daroff, RB, Fenichel, GM, Jankovic, J (Eds), Butterworth Heinmann, Philadelphia, PA 2004. p.51. Copyright &copy; 2004 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
